import { flatten } from "lodash";
import React from "react";
import Map from "../map/map";
import styles from "./goal.module.scss";
import TimeSliderTemp from "./time-slider-temp.svg";

export const TIMELINE_SCALES = {
    Yearly: 1,
    Monthly: 2,
    Daily: 3,
};

const getDefaultIndicatorState = (pillar, goal) => {
    // TODO: module
    const bivariateYOptions = flatten(pillar.goals.map(d => d.indicators));

    const mapVisualisationOptions = goal.indicators.filter(d => d.isProgressIndicator);

    return {
        // Question indicator is the X axis
        bivariateX: goal.indicators[0],
        bivariateXEnabled: true,
        // Any indicator for the pillar on the Y axis
        bivariateY: bivariateYOptions.length > 1 ? bivariateYOptions[1] : bivariateYOptions[0],
        bivariateYEnabled: false,
        // "above-map" layer, be it simple circles or whatever. Is a "progress indicator".
        mapVisualisation: mapVisualisationOptions[0],
        mapVisualisationEnabled: mapVisualisationOptions.length > 0,
    };
};

function useIndicatorState(pillar, goal) {
    const [currentIndicators, setCurrentIndicators] = React.useState(
        getDefaultIndicatorState(pillar, goal)
    );

    // TODO: remove most of this logic. goal and pillar won't change.

    React.useEffect(() => {
        if (!pillar) return;
        // Whenever active pillar changes, set the pillar indicator (Y) to the first avail.
        const bivariateYOptions = flatten(pillar.goals.map(d => d.indicators)).filter(
            d => !d.categorical
        );
        setCurrentIndicators(d => ({
            ...d,
            bivariateY: bivariateYOptions.length > 1 ? bivariateYOptions[1] : bivariateYOptions[0],
        }));
    }, [pillar]);

    React.useEffect(() => {
        if (!goal) return;
        if (goal.categorical) {
            setCurrentIndicators(d => ({
                ...d,
                bivariateX: goal.indicators.filter(d => !d.categorical)[0],
                bivariateXEnabled: false,
                bivariateYEnabled: false,
                mapVisualisationEnabled: true,
            }));
        } else {
            // Whenever active QUESTION changes, set the pillar indicator to the first for the question
            setCurrentIndicators(d => ({
                ...d,
                bivariateX: goal.indicators[0],
                bivariateXEnabled: true,
                bivariateYEnabled: false,
            }));
        }
    }, [goal]);
    return [currentIndicators, setCurrentIndicators];
}

export default function Goal(props) {
    const { goal, pillar, regionLookup, pillarLoading, goalDatasets } = props;

    // TODO: make this context?
    const [currentIndicators, setCurrentIndicators] = useIndicatorState(pillar, goal);

    const [currentTime, setCurrentTime] = React.useState(new Date());
    const [timelineRange, setTimelineRange] = React.useState();

    const countryData = React.useMemo(() => {
        if (!goalDatasets) return {};

        let newData = {};

        // Prefill the object.
        Object.values(regionLookup).forEach(region => {
            newData[region["ISO-alpha3 Code"]] = { ...region };
        });

        // TODO: don't go through _all_ datasets. Intelligently select based on indicators.
        // TODO: filter to within range.
        Object.values(goalDatasets).forEach(dataset => {
            dataset
                .filter(d => d.Year <= currentTime)
                .sort((a, b) => a.Year - b.Year)
                .forEach(row => {
                    const rowKey = row["Alpha-3 code"];
                    newData[rowKey] = newData[rowKey] || {};

                    Object.entries(row)
                        .filter(([key, value]) => Boolean(value))
                        .forEach(([key, value]) => {
                            newData[rowKey][key] = value;
                        });
                });
        });

        return newData;
    }, [goalDatasets, regionLookup]);

    return (
        <div className={styles.goal}>
            <div className={styles.tempGoalHeader}>
                <h2>{goal.label}</h2>
                <p>{goal.description}</p>
            </div>
            <div className={styles.mapArea}>
                <div className={styles.mapSidebar}>
                    <div className={styles.sidebarBlock}>
                        <PlaceholderMapSidebarVis goal={goal} index={0} />
                    </div>
                    <div className={styles.sidebarBlock}>
                        <PlaceholderMapSidebarVis goal={goal} index={1} />
                    </div>
                    {goal.label !== "Vulnerable population and groups we must reach" && (
                        <div className={styles.sidebarBlock}>
                            <PlaceholderMapSidebarVis goal={goal} index={2} />
                        </div>
                    )}
                </div>
                <div className={styles.mapContainer}>
                    <Map
                        countryData={countryData}
                        countryDataLoading={pillarLoading}
                        pillar={pillar}
                        goal={goal}
                        currentIndicators={currentIndicators}
                        setCurrentIndicators={setCurrentIndicators}
                    />
                </div>
            </div>
            <div className={styles.timeArea}>
                <img src={TimeSliderTemp} alt="temporary time slider" />
            </div>
            <div className={styles.graphArea}>
                <PlaceholderGraphs goal={goal} />
            </div>
            {/*!isMapOnly && (
            <Questions
                pillar={pillar}
                datasets={datasets}
                countryData={countryData}
                hdiIndicator={hdiIndicator}
            />
        )*/}
        </div>
    );
}

